--
-- Disparadores `attendance_calendar`
--
DROP TRIGGER IF EXISTS `td_cal_missing_attendance`;
DELIMITER //
CREATE TRIGGER `td_cal_missing_attendance` AFTER DELETE ON `attendance_calendar`
 FOR EACH ROW DELETE mi.* FROM missing_attendance mi,course_periods cp WHERE mi.course_period_id=cp.course_period_id and cp.calendar_id=OLD.calendar_id AND mi.SCHOOL_DATE=OLD.school_date
//
DELIMITER ;
DROP TRIGGER IF EXISTS `ti_cal_missing_attendance`;
DELIMITER //
CREATE TRIGGER `ti_cal_missing_attendance` AFTER INSERT ON `attendance_calendar`
 FOR EACH ROW BEGIN
     DECLARE associations INT;
     SET associations = (SELECT COUNT(course_period_id) FROM `course_periods` WHERE calendar_id=NEW.calendar_id);
     IF associations>0 THEN
 	CALL ATTENDANCE_CALC_BY_DATE(NEW.school_date, NEW.syear,NEW.school_id);
     END IF;
 END
//
DELIMITER ;

